import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
  align-items: center;
`;

export const Main = styled.div`
  display: flex;
  flex-direction: column;
  max-width: 400px;

  align-items: center;
  justify-content: center;
  color: #363535;
  background: #fff;
  border-radius: 10px;
`;

export const Phrase = styled.div`
  max-width: 200px;
`;
